          <!-- Navigation -->
          <nav class="px-3 mt-6">
            <div class="space-y-1">
              <a @click="goto(item)" v-for="item in navigation" :key="item.name" :href="item.href" :class="[isCurrent(item) ? 'bg-gray-200 text-gray-900' : 'text-gray-700 hover:text-gray-900 hover:bg-gray-50', 'group flex items-center px-2 py-2 text-sm font-medium rounded-md']" :aria-current="isCurrent(item) ? 'page' : undefined">
                <component :is="item.icon" :class="[isCurrent(item) ? 'text-gray-500' : 'text-gray-400 group-hover:text-gray-500', 'mr-3 h-6 w-6']" aria-hidden="true" />
