<script>
import { useStore } from 'vuex'
import { computed } from 'vue'
import TurbineIcon from '../icons/TurbineIcon.vue'
import WindIcon from '../icons/WindIcon.vue'
import {
  Dialog,
  DialogOverlay,
  Menu,
  MenuButton,
  MenuItem,
  MenuItems,
  TransitionChild,
  TransitionRoot,
} from '@headlessui/vue'
import {
  HomeIcon,
  MenuAlt2Icon,
  PlusIcon,
  SelectorIcon,
  ViewGridIcon,
  XIcon,
} from '@heroicons/vue/solid'
import { ClockIcon } from '@heroicons/vue/outline'
import { SearchIcon } from '@heroicons/vue/solid'

const navigation = [
  { name: 'Home', path: '', href: '#', icon: HomeIcon, current: true },
  { name: 'Dashboard', path: 'dashboard', href: '#', icon:ViewGridIcon, current: false },
  { name: 'Maintenance', path: 'maintenance', href: '#', icon: ClockIcon, current: false }
]

export default {
  components: {
    Dialog,
    DialogOverlay,
    Menu,
    MenuButton,
    MenuItem,
    MenuItems,
    TransitionChild,
    TransitionRoot,
    MenuAlt2Icon,
    PlusIcon,
    SearchIcon,
    SelectorIcon,
    XIcon,
    TurbineIcon,
    WindIcon
  },
  setup() {
    var store = useStore()
    const mobileMenuOpen = computed(() => {
      return store.state.navigation.mobileMenuOpen
    })
    const turbines = computed(() => {
      return store.state.farm.turbines
    })

    return {
      mobileMenuOpen,

      navigation,
      turbines
    }
  },  
  created() {
    this.$store.dispatch('farm/loadTurbines');
  },
  methods: {
    setMobileMenuOpen(value) {
      this.$store.dispatch('navigation/setMobileMenuOpen', value)
    },
    goto(item) {
        if (item) {
          this.setMobileMenuOpen(false)
          this.$router.push(`/${item.path}`)    
        }
    },
    gotoTurbine(item) {
        if (item) {
          this.setMobileMenuOpen(false)
          this.$router.push({ path: `/turbine/${item.id}` })   
        }
    },
    isCurrent(item) {
      if (item && item.name) {
        return this.$route.matched.some(({ name }) => name.toLowerCase() === item.name.toLowerCase())
      }
    },
    isTurbineCurrent(item) {
      if (item && item.name && this.$route.params) {
        return this.$route.matched.some(({ name }) => name.toLowerCase() === 'turbine') && this.$route.params.id == item.id
      }
    }
  }
}
</script>